import React, { Component } from 'react'
import { BrowserRouter, Route, Routes }  from "react-router-dom";
import Home from './page/Home';
import Admin from './page/Admin';
import Users from './page/Users';
import Login from './page/Login';
import Footer from './components/Footer'
import Header from './components/Header'
import Menu from './components/Menu'
import Adminform from './page/Adminform';
import Userform from './page/Userform';
export default class App extends Component {
  state = {
    login:false
  }
  render() {
    return (
    <BrowserRouter>
    {this.state.login ? <><Header/><Menu/></>:null}


      <Routes>
        <Route exact path="/" element={<Home />} />
        <Route exact path="/login" element={<Login />} />
        <Route exact path="/admin" element={<Admin />} />
        <Route exact path="/adminform" element={<Adminform />} />
        <Route exact path="/adminform/:id" element={<Adminform />} />
        <Route exact path="/users" element={<Users />} />
        <Route exact path="/userform" element={<Userform />} />
        <Route exact path="/userform/:id" element={<Userform />} />
      </Routes>
      {this.state.login ? <Footer/>:null}
    </BrowserRouter>
    )
  }
}
